import React from 'react';
import { Sw } from 'react-router-dom';
import Routes from './routes';
import GlobalStyle from './styles/global';
import Header from './components/Header';

function App() {
    return (
        <BrowserRouter>
            <Header />
            <GlobalStyle />
            <Routes />
        </BrowserRouter>
    );
}

export default App;
